import React from "react";

import Footer from "../Footer/Foot";
import Products from "../Products.jsx/Products";
import ProductData from "../Data/ProductData";

function Cars() {
  const productElement = ProductData.map((item) => {
    return (
      <Products
        key={item.id}
        img={item.img}
        price={item.price}
        engine={item.engine}
        fuel={item.fuel}
        hspwr={item.horsepower}
        mileage={item.mileage}
      />
    );
  });
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-4" style={{ backgroundColor: "grey" }}>
            Hello
          </div>
          <div
            className="col-md-7 offset-md-1"
            style={{ backgroundColor: "grey" }}
          >
            <div className="row mt-4 p-3" style={{ maxWidth: "1300px" }}>
          {productElement}
          <Footer />
        </div>
          </div>
        </div>
      </div>
      <div className="container-fluid d-flex justify-content-center">
        <div className="row mt-4 p-3" style={{ maxWidth: "1300px" }}>
          {productElement}
          <Footer />
        </div>
      </div>
    </>
  );
}
export default Cars;
